import React from 'react';
import Learn from './learn';
import Test from './test';
import CanvasDraw from "react-canvas-draw";

const Home = props => {

	const {router:{query}}=props;
	const {type}=query;


if(type==='test') return <Test/>;
return <Learn/>;
}



export default Home;
